    false,nt"url": null,nt"notes": "This annual narrative report for Tetlin
    National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, the management plan, public participation, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, fire management, and wilderness areas. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    and animal control. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, trapping, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, equipment replacement, and communication systems.",nt"owner_org":
